import React from "react";
import ReactDom from "react-dom/client";
import "./App.css";

class Car {
  constructor(name, no) {
    this.brand = name;
    this.num = no;
  }

  present() {
    return "I have a " + this.brand;
  }
}

class Model extends Car {
  constructor(name, no, mod) {
    super(name, no);
    this.model = mod;
  }

  show() {
    return (
      this.present() + "', it is a " + this.model + "and no is: " + this.num
    );
  }
}

const mycar = new Car("Ford");
const myfor = new Model("Toyota", 10, "Fortune");

const root = ReactDom.createRoot(document.getElementById("root"));
root.render(
